form.script:
          $(document).ready(function() {
	$(".sizesoo").click(function(){								 
		index = $(".sizesoo").index(this);
		num = $(".sizenum").eq(index).val();
		num = isNaN(num) ? 0 : parseInt(num);
		num--;
		if(num <=0) { num = 0;}
		$(".sizenum").eq(index).val(num);		
	});
	$(".sizeadd").click(function(){								  
		index = $(".sizeadd").index(this);
		num = $(".sizenum").eq(index).val();
		num = isNaN(num) ? 0 : parseInt(num);
		num++;
		if(num <=0) { num = 1;}
		$(".sizenum").eq(index).val(num);		
	});
});

function checksi(){ 
	sizelen = $(".sizenum").length;
	if(sizelen>0) {
		buyok = false;	
	} else { buyok = true;	}

	for(i=0; i< sizelen; i++) {
		tval = $(".sizenum").eq(i).val();
		tval = isNaN(tval) ? 0 : parseInt(tval);
		if(tval > 0) {
			buyok = true;	
		}
	}
	if(!buyok) {
		alert("Please fill in the number of shopping");
		return false;
	}	
	return true;
}
